import React ,{useState , useEffect} from 'react'
import axios from 'axios'
function Home() {
    const [data, setdata] = useState([]);

    useEffect(() => {
        axios
        .get('https://jsonplaceholder.typicode.com/posts')
        .then((results)=>{

            console.log('o');

            setdata(results.data)


        })
        .catch((err) =>{
        })
    },[])

    return (
        <div>
            <h1>Home</h1>
            {
                data.map(item =>(
                    <p key ={item.id}> {item.title} </p>
                ))
            }
        </div>
    )
}

export default Home
